import { setUserDetails } from '../Actions';

const initialState = {
    userData: []
}
const Reducer = (state = initialState, action) => {
    switch(action.type) {
        case setUserDetails.type: 
            return {...state, data: action.data};
        default:
            return state;
    }
}

export default Reducer;
